import React, { Component } from 'react';
export default class ContactUs extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <form id='contact'>
      <h1>Me contact</h1>
      <p>Votre Nom:</p>
      <input type="text"/>
      <p>Votre Prenom:</p>
      <input type="text"/>
      <p>Votre Message:</p>
      <input type="textarea"/>

      <input type="submit" value="Envoyer" />
    </form>
        );
  }
}
